package main

import (
	"math/big"
	"crypto/rand"
	"fmt"
	"encoding/base64"
)

func RandInt64(min, max int64) int64 {
	maxBigInt := big.NewInt(max)
	i, _ := rand.Int(rand.Reader, maxBigInt)
	if i.Int64() < min {
		RandInt64(min, max)
	}
	return i.Int64()
}

func main() {
	arr := []string{"Ntfk02", "QQJ8799"}
	fmt.Println(arr[RandInt64(0, 2)])

	source := ``
	b_s,_ := base64.StdEncoding.DecodeString(source)
	decode_source := string(b_s)
	fmt.Println(decode_source)
}
